#include "http_parser.h"
#include <stdint.h>
#include <stdlib.h>
#include <string.h>

int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  if (size < 1) {
    return 0;
  }
  enum http_errno err = (enum http_errno)(data[0] % HTTP_ERRNO_MAX);
  const char* errname = http_errno_name(err);
  return 0;
}

